export default class NavBar extends React.Component {
    render() {
        return <div className="main--navbar">
            <div className="navBar--title">
                <h1>Enjoy</h1>
            </div>
            <div className="navBar--links">
                <a href="">Contact</a>
            </div>
        </div>
    }
}
